#include <iostream>

unsigned int dzielniki(unsigned int n) {
	if (n == 0) {
		return 0;
	}
	if (n == 1) {
		return 1;
	}
	unsigned int wynik{2};
	for (auto i{ 2 }; i < n; ++i) {
		if (n % i == 0) {
			++wynik;
		}
	}
	return wynik;
}

bool czyPierwsza(unsigned int liczba) {
	if (dzielniki(liczba) == 2) {
		return true;
	}
	return false;
}

